import React, { Component } from "react";
import Todolist from "./Todolist";
import "./App.css";

class App extends Component {
  state = {
    todos: [{ id: 1, content: "buy" }]
  };
  render() {
    return (
      <div className="container">
        <div className="header">
          <h1>Todos</h1>
        </div>
        <Todolist todos={this.state} />
      </div>
    );
  }
}

export default App;
